import './App.css';
import CakeContainer from './components/CakeContainer';
import { HooksCakeContainer } from './components/HooksCakeContainer';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  NavLink
} from 'react-router-dom'
import UserContainer from './components/UserContainer';
import HooksUserContainer from './components/HooksUserContainer';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>ROUTERS:-</h1>
        <ul>
          <li><NavLink to="/">Buy Cake</NavLink></li>
          <li><NavLink to="/buy_Cake_shared_state">shared state Buy Cake</NavLink></li>
          <li><NavLink to="/get_User">Get User</NavLink></li>
          <li><NavLink to="/get_User_shared_state">Shared State Get User</NavLink></li>
        </ul>
        <Switch>
          <Route exact path="/">
            <CakeContainer />
          </Route>
          <Route exact path="/buy_Cake_shared_state">
            <HooksCakeContainer />
          </Route>
          <Route path="/get_User">
            <UserContainer />
          </Route>
          <Route path="/get_User_shared_state">
            <HooksUserContainer />
          </Route>
        </Switch>
        {/* <CakeContainer />
      <UserContainer /> */}
      </div>
    </Router>
  );
}

export default App;
